import React from 'react';
import PeopleCard from './PeopleCard'



const PeopleList = ({array}) => {

	return (

		<div>
		{ 

			array.filter((heros,i) => {
				return (
					<PeopleCard
					key={i}
					id={array[i].id}
					name={array[i].name}
					gender={array[i].gender}
					height={array[i].height}
					mass={array[i].mass}
					/>

					);
			})

		}
		</div>
		)
		}


export default PeopleList
